/* Function  structure for function  `func_get_var_id` */

/*!50003 DROP FUNCTION IF EXISTS `func_get_var_id` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `func_get_var_id`(dsc___name VARCHAR(100)) RETURNS int(11)
    READS SQL DATA
BEGIN
    DECLARE xxxx INT default 0;
    
     SELECT dsc_id into xxxx FROM tbl_variables WHERE dsc_name=dsc___name limit 1;
   
    RETURN xxxx;
   END */$$
DELIMITER ;

/* Function  structure for function  `my_last_insert_id_from_tbl_letters` */

/*!50003 DROP FUNCTION IF EXISTS `my_last_insert_id_from_tbl_letters` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `my_last_insert_id_from_tbl_letters`() RETURNS int(11)
BEGIN
 DECLARE t1_max_a INT DEFAULT NULL;
 SELECT MAX(l_id) 
   INTO t1_max_a
   FROM tbl_letters;
 RETURN t1_max_a;
END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_insert_into_tbl_letters` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_insert_into_tbl_letters` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_insert_into_tbl_letters`(
    creator_company_name NVARCHAR(100),
    creator_person_name NVARCHAR(100),
    type_name nvarchar(100),
    letter_link_no nvarchar(100),
    type_of_recieve nvarchar(100),
    date_of_create datetime,
    attachment_count int,
    letter_number varchar(30),
    date_of_letter datetime,
    letter_text text,
    created_uname varchar(100),
    ll_subject varchar(300)
    )
    MODIFIES SQL DATA
BEGIN
INSERT INTO tbl_letters (
l_creator_company_link,
l_creator_person_link,
l_type_link,
l_letter_to_link,
l_type_of_recieve_link,
l_date_of_create,
l_attachment_count,
l_letter_number,
l_date_of_letter,
l_letter_text,
l_created_user,
l_subject
) 
VALUEs (
func_get_var_id(creator_company_name),
func_get_var_id(creator_person_name),
type_name,
letter_link_no,
func_get_var_id(type_of_recieve),
date_of_create,
attachment_count,
letter_number,
date_of_letter,
letter_text,
(select u_id from tbl_users where u_name=created_uname limit 1),
ll_subject 
);
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_update_into_tbl_letters` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_update_into_tbl_letters` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_update_into_tbl_letters`(
id int,    
    creator_company_name NVARCHAR(100),
    creator_person_name NVARCHAR(100),
    type_name nvarchar(100),
    letter_link_no nvarchar(100),
    type_of_recieve nvarchar(100),
    date_of_create datetime,
    attachment_count int,
    letter_number varchar(30),
    date_of_letter datetime,
    letter_text text,
        created_uname VARCHAR(100),
    ll_subject VARCHAR(300)
    )
    MODIFIES SQL DATA
BEGIN
update  tbl_letters set
l_creator_company_link=func_get_var_id(creator_company_name),
l_creator_person_link=func_get_var_id(creator_person_name),
l_type_link=type_name,
l_letter_to_link=letter_link_no,
l_type_of_recieve_link=func_get_var_id(type_of_recieve),
l_date_of_create=date_of_create,
l_attachment_count=attachment_count,
l_letter_number=letter_number,
l_date_of_letter=date_of_letter,
l_letter_text=letter_text ,
l_created_user=(SELECT u_id FROM tbl_users WHERE u_name=created_uname LIMIT 1),
l_subject=ll_subject 
where l_id=id;
    END */$$
DELIMITER ;

